import * as Yoka from './export';
export default Yoka;
declare global {
    namespace JSX {
        interface IntrinsicHTMLElement {
            className?: string;
            id?: string;
            style?: string;
            onclick?: HTMLElement["onclick"];
            onchange?: HTMLElement["onchange"];
            onblur?: HTMLElement["onblur"];
            oninput?: HTMLElement["oninput"];
        }
        interface IntrinsicHTMLAnchorElement extends IntrinsicHTMLElement {
            href?: string;
        }
        interface IntrinsicHTMLLabelElement extends IntrinsicHTMLElement {
            for?: string;
        }
        interface IntrinsicHTMLOListElement extends IntrinsicHTMLElement {
            reversed?: string;
            start?: string;
        }
        interface IntrinsicHTMLDetailsElement extends IntrinsicHTMLElement {
            open?: boolean;
        }
        interface IntrinsicHTMLFormElement extends IntrinsicHTMLElement {
            method?: "dialog" | "GET" | "POST";
            onsubmit?: HTMLElement["onsubmit"];
        }
        interface IntrinsicHTMLButtonElement extends IntrinsicHTMLElement {
            type?: "button" | "reset" | "submit";
        }
        interface IntrinsicHTMLInputElement extends IntrinsicHTMLElement {
            min?: string;
            max?: string;
            name?: string;
            readonly?: true;
            step?: string;
            type?: "checkbox" | "number" | "text" | "password" | "search";
            value?: string;
        }
        interface IntrinsicViewElement extends IntrinsicHTMLElement {
            sex: string;
        }
        interface IntrinsicElements {
            a: IntrinsicHTMLAnchorElement;
            button: IntrinsicHTMLButtonElement;
            details: IntrinsicHTMLDetailsElement;
            dialog: IntrinsicHTMLElement;
            div: IntrinsicHTMLElement;
            form: IntrinsicHTMLFormElement;
            h1: IntrinsicHTMLElement;
            h2: IntrinsicHTMLElement;
            h3: IntrinsicHTMLElement;
            h4: IntrinsicHTMLElement;
            h5: IntrinsicHTMLElement;
            h6: IntrinsicHTMLElement;
            input: IntrinsicHTMLInputElement;
            label: IntrinsicHTMLLabelElement;
            li: IntrinsicHTMLElement;
            ol: IntrinsicHTMLOListElement;
            section: IntrinsicHTMLElement;
            span: IntrinsicHTMLElement;
            small: IntrinsicHTMLElement;
            summary: IntrinsicHTMLElement;
            ul: IntrinsicHTMLElement;
        }
        interface AttributeCollection {
            [name: string]: any;
        }
    }
}
